description:
ПРОДАМ!
Красивую, стильную 2х комнатную квартиру в престижном ЖК ОМЕГА в Одессе
Общая площадь 70 метров.
Квартира распланирована в две раздельные комнаты 17кв м и 13кв м и просторную
кухню-гостиную 30 кв м, вместительную гардеробную, совмещенный санузел с ванной
Квартира двухсторонняя - юго-восток и запад
Потрясающий вид на море, Большой Фонтан,
Выполнен современный, качественный ремонт.
Квартира укомплектована мебелью и полностью всей необходимой техникой.
Дом сдан и введён в эксплуатацию в 2020 г
ЖК Омега от надежной СК Будова
- консьержи в холле;
- скоростные лифты OTIS 2 пассажирских и 1 грузовой с индивидуальными ключами;
- двухуровневый паркинг;
- Огромная, закрытая, охраняемая территория с видеонаблюдением
- оборудованные места для отдыха и спортивные площадки для детей и взрослых;
- тепло в доме обеспечено автономными крышными газовыми котельными;
- наличие резервного электроснабжения
- наличие дизель–генератора ,
ЖК Омега это в радиусе 300-500 м.:
- парк им. Горького;
- супермаркеты «Космос», «Мега Дом»;
- магазины Таврия В, Сельпо;
- школы №5, 11, 27, 28, 33, 51, 100 и детские сады;
- больница, медицинский центр и детская поликлиника №6;
- кафе, АЗС, отделения банков.
Транспортная развязка - одна из лучших в городе, что позволяет быстро добраться до необходимой части города.
Оформлено право собственности!
